import React from 'react';
import './App.css';
import Header from './components/Header/Header.jsx';
import NavBar from './components/NabBar/NavBar.jsx';
import Profile from './components/Profile/Profile';


function App() {
  return (
    <div className="app_wrapper">
      <Header />
      <NavBar />
      <Profile />
    </div>
  );
}

export default App;
